import React from 'react'
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";
import "./ParticleBg.css"

const ParticleBg = () => {
    const particlesInit = async (main) => {
        console.log(main);
        await loadFull(main);
      };

      


  return (
    
    <Particles
    id="tsparticles"
    init={particlesInit}
    
    options={{
      "particles": {
        number: {
          value: 5,
        },
        size: {
          value: 5,
        },
        color: {
          value: "#ffffff", // Set the color value to white
        },
      },
      "Interativity":{
        "events":{
          "onhover":{
            "enable": true,
            "mode":"repulse"
          }
        }},

        background: {
          color: {
            value: "#000000", // Set the color value to black
          },
        },


      



    }}
/>
  )
}

export default ParticleBg
